USE `bd_servicio`;

DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ingresar_usuarios`(vnombres varchar(100),
vapellidos varchar(100),vcedula varchar(10),
vemail varchar(100),
vdireccion varchar(200),vtelefono varchar(15),
vdescripciontu varchar(200),
valias varchar(100), vdpassword varchar(100))
BEGIN
declare vid_persona int;
	declare vid_tipousuario int;
	declare vid_usuario int;
	Insert into personas(nombres,apellidos,cedula,email,direccion,telefono,estado)
				values(vnombres,vapellidos,vcedula,vemail,vdireccion,vtelefono,'A');
	set vid_persona=(select max(id_persona) from personas where estado='A');
	set vid_tipousuario=(select id_tipousuario from tipousuario as tu where tu.estado='A' and tu.descripcion=vdescripciontu);
	Insert into usuario(id_tipousuario,id_persona,estado)
				values(vid_tipousuario,vid_persona,'A');
set vid_usuario=(select max(id_usuario) from usuario where estado='A');
	Insert into datosusuario(id_usuario,alias,dpassword,estado)
				values(vid_usuario,valias,vdpassword,'A');
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_modificar_datos_usuario`(
v_id_persona int,
v_alias varchar(100),
v_dpassword varchar(100))
BEGIN
	Update datosusuario set alias=v_alias,
			                dpassword=v_dpassword
                   where id_usuario=(select id_usuario from usuario where id_persona=v_id_persona and estado='A') and estado='A';
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_modulo_usuarios`(v_id_persona int,
v_nombres varchar(100),
v_apellidos varchar(100),
v_cedula varchar(10),
v_email varchar(100),
v_direccion varchar(100),
v_telefono varchar(15),
v_id_tipo_usuario int,
accion int)
BEGIN
	IF accion=1 THEN
		Update personas set id_persona=v_id_persona,
				    nombres=v_nombres,
			            apellidos=v_apellidos,
    				    cedula=v_cedula,
 				    email=v_email,
				    direccion=v_direccion,
				     telefono=v_telefono
				   where id_persona=v_id_persona and estado='A';
		Update usuario set id_tipousuario=v_id_tipo_usuario where estado='A' and id_persona=v_id_persona;
	ELSE
		Update personas set estado='I' where id_persona=v_id_persona;
		Update usuario set estado='I' where id_persona=v_id_persona;
		update datosusuario set estado='I' where id_usuario=(select id_usuario from usuario where id_persona=v_id_persona);
	END IF;
END$$

DELIMITER ;

